    useEffect(() => {
        axios.get('http://localhost:5000/users')
    .then(response => {
        setUsers(response.data);
    })
    .catch(error => {
        console.error('Error fetching user data: ', error);
    });
    }, []);

    const handleLogout = () => {
        // ログアウト状態に更新する関数を呼び出す
        setIsLoggedIn(false);
        // クッキーを削除
        Cookies.remove('username');
    };


  return (
    <div>
      <button onClick={handleLogout}>Logout</button>
    </div>
  );
};

